commit_message:
- Method invocation references are recursively collected in Indexer. - Improved the performance of method call analyzer. If the type of the reference through which a polymorphic method is called can be statically determined, then only the overriding implementation of the subclass type corresponding to the reference type is analyzed. The following code snippet taken from the Soot Java optimization framework has been used as a case study: soot.jimple.spark.pag.PAG.mergedWith(Node, Node)

HashSet<Node> s = new HashSet<Node>( size1+size2 );
for (Object o : os) {
	if( o == null ) continue;
	if( o instanceof Set ) {
		s.addAll( (Set) o );
	} else {
		Node[] ar = (Node[]) o;
		for (Node element1 : ar) {
			s.add( element1 );
		}
	}
}

Improved the matching of element access expressions in ConditionalLoops, which are the invoker expressions of method calls. File path: /apache-jmeter-2.11/src/core/org/apache/jmeter/gui/util/JLabeledRadioI18N.java
Method name: void notifyChangeListeners()
mChangeListeners.get(index).stateChanged(ce);

File path: /apache-jmeter-2.11/src/reports/org/apache/jmeter/gui/util/ReportFilePanel.java
Method name: void fireFileChanged()
iter.next().stateChanged(new ChangeEvent(this));

Added the following method in class ControlDependenceTreeNode that sets the parameter as the ifParent of 'this' and sets 'this' as the elseIfChild of the parameter public void setIfParentAndElseIfChild(ControlDependenceTreeNode ifParent) {
	this.ifParent = ifParent;
	ifParent.elseIfChild = this;
}

